async function questionCreate(index, pitanje, odgovor1, odgovor2, odgovor3, odgovor4, tacanIndex, kategorija, tezina) {  
  let novaTezina = "";
  let noviTacan = "";
  let noviNe1 = "";
  let noviNe2 = "";
  let noviNe3 = "";

  // Trim whitespace and remove extra spaces
  pitanje = pitanje.trim();
  odgovor1 = odgovor1.trim();
  odgovor2 = odgovor2.trim();
  odgovor3 = odgovor3.trim();
  odgovor4 = odgovor4.trim();

  pitanje = pitanje.replace(/\s{2,}/g, ' ');
  odgovor1 = odgovor1.replace(/\s{2,}/g, ' ');
  odgovor2 = odgovor2.replace(/\s{2,}/g, ' ');
  odgovor3 = odgovor3.replace(/\s{2,}/g, ' ');
  odgovor4 = odgovor4.replace(/\s{2,}/g, ' ');

  // Set difficulty as string
  if (tezina === 1) {
    novaTezina = "Lako";
  } else if (tezina === 2) {
    novaTezina = "Srednje";
  } else if (tezina === 3) {
    novaTezina = "Tesko";
  } else {
    console.log("Nema tezine");
  }

  // Set answers depending on the answer's correct index
  if (tacanIndex === 0) {
    noviTacan = odgovor1;
    noviNe1 = odgovor2;
    noviNe2 = odgovor3;
    noviNe3 = odgovor4;
  } else if (tacanIndex === 1) {
    noviTacan = odgovor2;
    noviNe1 = odgovor1;
    noviNe2 = odgovor3;
    noviNe3 = odgovor4;
  } else if (tacanIndex === 2) {
    noviTacan = odgovor3;
    noviNe1 = odgovor1;
    noviNe2 = odgovor2;
    noviNe3 = odgovor4;
  } else if (tacanIndex === 3) {
    noviTacan = odgovor4;
    noviNe1 = odgovor1;
    noviNe2 = odgovor2;
    noviNe3 = odgovor3;
  }

  const pitanjeDetalji = {
    pitanje: pitanje,
    tacanOdg: noviTacan,
    netacanOdg1: noviNe1,
    netacanOdg2: noviNe2,
    netacanOdg3: noviNe3,
    kategorija: kategorija,
    tezina: novaTezina,
  };

  const questionModel = new Question(pitanjeDetalji);
  await questionModel.save();
  // questions[i++] = questionModel;
}
    
